import React, {Component} from 'react';

class Header extends Component {

  render() {
    return (
      <header className="header">
        <h1 className="heading-main--large">
          Lunch in LDN
        </h1>
        <h2 className="heading-main--sub">
          Curated by cuisine
        </h2>
    </header>
    )
  }

}

export default Header;
